import 'react-native-gesture-handler';
import { SafeAreaProvider } from 'react-native-safe-area-context';
import { AppearanceProvider } from 'react-native-appearance';
import './constants';
import { NavigationContainer } from '@react-navigation/native';
import { Header } from './navigation/Header';
import { Main } from './navigation/Main';
import { Footer } from './navigation/Footer';
import { DimensionsBox } from './components/DimensionsBox';
import { setCustomView } from 'react-native-global-props';
import { useFonts } from 'expo-font';

const Colors = './constants/colors';
const customViewProps = {
  style: {
    backgroundColor: Colors.LIGHT_GRAY,
  },
};
setCustomView(customViewProps);

const showDimensionsBox = false;

export default function App() {
  const [loaded] = useFonts({
    ObjektivRegular: require('./../assets/fonts/ObjektivMk2-Regular.ttf'),
    ObjektivMedium: require('./../assets/fonts/ObjektivMk2-Medium.ttf'),
    ObjektivBold: require('./../assets/fonts/ObjektivMk2-Bold.ttf'),
  });

  if (!loaded) {
    return null;
  }
  return (
    <>
      <AppearanceProvider>
        <NavigationContainer>
          <SafeAreaProvider>
            <Header />
            <Main />
            {showDimensionsBox && <DimensionsBox />}
            <Footer />
          </SafeAreaProvider>
        </NavigationContainer>
      </AppearanceProvider>
    </>
  );
}
